import React, { Component } from "react";
import "materialize-css/dist/css/materialize.min.css";
import M from "materialize-css/dist/js/materialize.min.js";

class Broodje extends Component {
  state = {};
  componentDidMount() {
    M.AutoInit();
  }
  render() {
    const { broodjesList } = this.props;
    const broodjes_List = broodjesList.map(broodje => {
      return (
        <div className="broodje">
          <h3>Broodje 1</h3>
          <div className="input-field col s12">
            <select defaultValue="">
              <option value="" disabled>
                Broodsoort
              </option>
              <option value="1">{broodje.broodSoort}</option>
            </select>
          </div>
          <div className="input-field col s12">
            <select defaultValue="">
              <option value="" disabled>
                Boter
              </option>
              <option value="1">{broodje.boter}</option>
            </select>
          </div>
          <div className="input-field col s12">
            <select defaultValue="">
              <option value="" disabled>
                Beleg
              </option>
              <option value="1">{broodje.beleg}</option>
            </select>
          </div>
        </div>
      );
    });
    return <div className="broodjes-list">{broodjes_List}</div>;
  }
}

export default Broodje;
